        public static OblivionMod CreateFromBinary(
            ModPath path,
            GroupMask? importMask = null,
            bool parallel = true,
            IFileSystem? fileSystem = null)
        {
            try
            {
                using (var reader = new MutagenBinaryReadStream(path, GameRelease.Oblivion, fileSystem: fileSystem))
