            {
                StringsWriter = param.StringsWriter,
                TargetLanguageOverride = param.TargetLanguageOverride,
            };
            var writer = new MutagenWriter(stream, bundle);
            ModHeaderWriteLogic.WriteHeader(
                param: param,
